import footerImg from '../static/images/FOOTER.png'

const footer = () => {
    return (
        <footer>
            <main>
                <section>
                    <h2>LOCATION</h2>
                    <p>Jalan Sumbersari,</p>
                    <p>Pekanbaru,</p>
                    <p>Indonesia</p>
                </section>
            </main>
        <style jsx>{`
            footer {
                margin-top: 2rem;
            }
            main {
                background: url(${footerImg});
                height: 20rem;
                width: auto;
            }
            section {
                color: #ffffff;
            }
            section > h2 {
                font-family: 'Alice',serif;
                margin: 0;
            }
            section > p {
                font-family: 'Lato';
                text-align: center;
            }
        `}</style>
        </footer>
    )
}

export default footer;
